types:
  Column:
    properties:
      enumProp: optional<TestEnum>
      id: string
      indexedData: optional<IndexedData>
      metadata: optional<Metadata>
      values: list<float>
    source:
      proto: proto/data/v1/data.proto
  DeleteResponse:
    properties: {}
    source:
      proto: proto/data/v1/data.proto
  DescribeResponse:
    properties:
      dimension: optional<uint>
      fullness: optional<float>
      namespaces: optional<map<string, NamespaceSummary>>
      totalCount: optional<uint>
    source:
      proto: proto/data/v1/data.proto
  FetchResponse:
    properties:
      columns: optional<map<string, Column>>
      namespace: optional<string>
      usage: optional<Usage>
    source:
      proto: proto/data/v1/data.proto
  IndexedData:
    properties:
      indices: list<uint>
      values: list<float>
    source:
      proto: proto/data/v1/data.proto
  ListElement:
    properties:
      id: optional<string>
    source:
      proto: proto/data/v1/data.proto
  ListResponse:
    properties:
      columns: optional<list<ListElement>>
      namespace: optional<string>
      pagination: optional<Pagination>
      usage: optional<Usage>
    source:
      proto: proto/data/v1/data.proto
  Metadata:
    discriminated: false
    encoding:
      proto:
        type: google.protobuf.Struct
    source:
      proto: proto/data/v1/data.proto
    union:
      - map<string, MetadataValue>
      - map<string, unknown>
  MetadataValue:
    discriminated: false
    encoding:
      proto:
        type: google.protobuf.Value
    source:
      proto: proto/data/v1/data.proto
    union:
      - double
      - string
      - boolean
  NamespaceSummary:
    properties:
      count: optional<uint>
    source:
      proto: proto/data/v1/data.proto
  Pagination:
    properties:
      next: optional<string>
    source:
      proto: proto/data/v1/data.proto
  QueryColumn:
    properties:
      filter: optional<Metadata>
      indexedData: optional<IndexedData>
      namespace: optional<string>
      topK: optional<uint>
      values: list<float>
    source:
      proto: proto/data/v1/data.proto
  QueryResponse:
    properties:
      matches: optional<list<ScoredColumn>>
      namespace: optional<string>
      results: optional<list<QueryResult>>
      usage: optional<Usage>
    source:
      proto: proto/data/v1/data.proto
  QueryResult:
    properties:
      matches: optional<list<ScoredColumn>>
      namespace: optional<string>
    source:
      proto: proto/data/v1/data.proto
  ScoredColumn:
    properties:
      id: string
      indexedData: optional<IndexedData>
      metadata: optional<Metadata>
      score: optional<float>
      values: optional<list<float>>
    source:
      proto: proto/data/v1/data.proto
  TestEnum:
    enum:
      - A
      - B
      - C
    source:
      proto: proto/data/v1/data.proto
  UpdateResponse:
    properties: {}
    source:
      proto: proto/data/v1/data.proto
  UploadResponse:
    properties:
      count: optional<uint>
    source:
      proto: proto/data/v1/data.proto
  Usage:
    properties:
      units: optional<uint>
    source:
      proto: proto/data/v1/data.proto
